"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><a name=\"cautions\"></a><span style=\" font-family:\'Times New Roman,serif\'; font-size:24pt; font-weight:600;\">E</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:24pt; font-weight:600;\">XPAR assistant Help</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><a name=\"SEQUENCE\"></a><span style=\" font-family:\'Times New Roman,serif\'; font-size:12pt;\">T</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:12pt;\">his tool is designed for EXPAR(exponential amplification reaction) template design.  </span></p>\n"
