"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times New Roman,serif\'; font-size:18pt; font-weight:600;\">Inputs</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times New Roman,serif\'; font-size:12pt; font-weight:600;\">Input sequences</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8pt;\">The input template sequences. They should be in fasta format. Also, Template should be in the format such as: &quot;trigger complementary&quot;+ &quot;4 post cut site complementary&quot; +&quot;GACTC&quot;+trigger complementary. Length of trigger complementary should be longer then 10 base pair</span><span style=\" font-family:\'MS Shell Dlg 2,sans-serif\'; font-size:8pt;\">.</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><a name=\"PRIMER_SEQUENCE_ID\"></a><span style=\" font-family:\'Times New Roman,serif\'; font-size:12pt; font-weight:600;\">M</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:12pt; font-weight:600;\">inimal trigger-template Tm</span><span style=\" font-size:8pt;\"> </span></p>\n"
